Fs = 64;            % Sampling frequency                    
T = 1/Fs;             % Sampling period       
L = 1024;             % Length of signal
t = (0:L-1)*T;        % Time vector

figure;
s_fft = fft(seven_preprocess_and_downsample);
P2 = abs(s_fft/L);
P1 = P2(1:L/2+1);
P1(2:end-1) = 2*P1(2:end-1);

f = Fs*(0:(L/2))/L;
plot(f,P1) 
title('Single-Sided Amplitude Spectrum of 7HZ Downsample and Digital Filter')
xlabel('f (Hz)')
ylabel('|P1(f)|')
ylim([0 12])


